import React from 'react';
import './Home.css';
const Home = () => {
  return (
    <div className="homeNotice">
      <br />
      <h1>읽은 책이나 본 영화를 사진으로 저장해보세요.</h1>
      <br />
      <h2>검색을 통해 책 표지나 영화 포스터를 검색하세요.</h2>
      <h2>내 기기에서 직접 사진을 올릴 수도 있습니다.</h2>
    </div>
  );
};

export default Home;
